import React from 'react';

const Card = () => {
    return (
        <div className='tc'>
            <img src="https://robohash.org/hehehe?212%212" alt="robot img"/>
            <div>
                <h1>Fighter</h1>
                <p>You shall overcome !</p>
            </div>
        </div>
    )
}

export default Card;
